import React from "react";
import './Home.css'
import { Box, Container, Typography } from "@mui/material";

export const Home = () => {
  return (
    <>
      <Container>
        <Box
          sx={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            height: "100vh",
          }}
        >
          <Box
            sx={{
              height: "450px",
              width: "350px",
              border: "1px solid grey",
              padding: "25px 39px 25px 39px",
            }}
          >
            <Box >
              <Typography className="instagram_content_center" variant="h3" sx={{ color: "black" }}>
                Instagram
              </Typography>
            </Box>
          </Box>
        </Box>
      </Container>
    </>
  );
};
